Static variables are used to store data that needs to be persistent between function calls. They are initialized only once, at the start of the program, and their values are retained between function calls. Static variables are declared with the static keyword and can be used to store data that is shared among multiple functions or to store data that needs to be retained between function calls.

Local variables, on the other hand, are used to store data that is only needed within a specific function. They are initialized each time the function is called and their values are lost when the function returns. Local variables are declared without the static keyword and can only be accessed within the function in which they are declared.

